import React, { useEffect, useState } from 'react';

// Floating rings background animation using SVGs with gradient borders
const FloatingRingsBackground = ({ darkMode }) => {
  const [rings, setRings] = useState([]);
  
  useEffect(() => {
    // Generate random ring elements
    const generateRings = () => {
      const ringsCount = window.innerWidth < 768 ? 5 : 8;
      const newRings = [];
      
      for (let i = 0; i < ringsCount; i++) {
        // Calculate random properties for each ring
        const size = 150 + Math.random() * 300; // Size between 150px and 450px
        const xPos = Math.random() * 100; // Initial position between 0% and 100%
        const yPos = Math.random() * 100;
        // Increased thickness for better visibility
        const thickness = 10 + Math.random() * 30;
        // Random movement direction
        const xDirection = Math.random() > 0.5 ? 1 : -1;
        const yDirection = Math.random() > 0.5 ? 1 : -1;
        // Random movement duration
        const duration = 15 + Math.random() * 30; // Animation duration between 15s and 45s
        // Random movement distance in percentage
        const xDistance = 10 + Math.random() * 30; // Move 10-40% horizontally
        const yDistance = 10 + Math.random() * 30; // Move 10-40% vertically
        const delay = Math.random() * -20; // Random delay
        
        // Each ring gets its own unique ID for the gradient
        const gradientId = `gradient-${i}`;
        
        newRings.push({
          id: i,
          size,
          x: xPos,
          y: yPos,
          thickness,
          xDirection,
          yDirection,
          duration,
          xDistance,
          yDistance,
          delay,
          gradientId
        });
      }
      
      setRings(newRings);
    };
    
    generateRings();
    
    // Regenerate on window resize
    const handleResize = () => {
      generateRings();
    };
    
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  return (
    <div className="rings-animation-container absolute inset-0 overflow-hidden z-0" style={{ pointerEvents: 'none' }}>
      {/* SVG defs for all the gradients */}
      <svg width="0" height="0" style={{ position: 'absolute' }}>
        <defs>
          {rings.map(ring => (
            <linearGradient key={ring.gradientId} id={ring.gradientId} x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="rgb(132, 204, 22)" /> {/* lime-500 */}
              <stop offset="100%" stopColor="rgb(16, 185, 129)" /> {/* green-500 */}
            </linearGradient>
          ))}
        </defs>
      </svg>
      
      {/* The floating rings as SVG circles */}
      {rings.map((ring) => (
        <div
          key={ring.id}
          className="absolute"
          style={{
            width: `${ring.size}px`,
            height: `${ring.size}px`,
            opacity: darkMode ? 0.5 : 0.3, // Adjust opacity based on dark mode
            animation: `float-${ring.id} ${ring.duration}s ease-in-out infinite ${ring.delay}s`,
            left: `calc(${ring.x}% - ${ring.size / 2}px)`,
            top: `calc(${ring.y}% - ${ring.size / 2}px)`,
            backdropFilter: 'none',
            WebkitBackdropFilter: 'none'
          }}
        >
          {/* SVG circle with gradient stroke */}
          <svg width="100%" height="100%" viewBox="0 0 100 100" preserveAspectRatio="none">
            <circle 
              cx="50" 
              cy="50" 
              r={45} 
              fill="none" 
              stroke={`url(#${ring.gradientId})`} 
              strokeWidth={ring.thickness / (ring.size / 100)} 
            />
          </svg>
        </div>
      ))}
      
      {/* Create keyframe animations for each ring */}
      <style>
        {rings.map((ring) => `
          @keyframes float-${ring.id} {
            0%, 100% {
              transform: translate(0, 0);
            }
            50% {
              transform: translate(
                ${ring.xDirection * ring.xDistance}%, 
                ${ring.yDirection * ring.yDistance}%
              );
            }
          }
        `).join('')}
      </style>
    </div>
  );
};

const PulsatingGradient = ({ darkMode }) => {
  return (
    <div
      className="absolute inset-0 bg-gradient-to-r from-lime-500 to-green-500 shadow-lg transform -skew-y-6 sm:skew-y-0 sm:-rotate-6 sm:rounded-3xl"
      style={{
        animation: 'none', // No pulsating animation
        opacity: darkMode ? 0.4 : 0.3, // Slightly adjusted for visibility
        backdropFilter: 'none',
        WebkitBackdropFilter: 'none'
      }}
    />
  );
};

export { FloatingRingsBackground as RotatingRingsBackground, PulsatingGradient };
